import React from 'react';
import './mission.css';

class Form extends React.Component {
  constructor() {
    super();
    this.state = {
                  mission: "",
                  name: '',
                  planet: ""
                  }
  };
    render(){
      return(
        <>
          <h1> Mission to Mars Registration Form </h1>
          <div>
            <form onChange={this.handleChange}>
              <input type="text" placeholder="Mission" name="mission" value=""> </input>
            </form>
          </div>
        </>
      )
    }
}

export default Form;
